sources.main.scss:
@import "~bootstrap/scss/bootstrap";

body {
    background: url("img/background_pattern.png");
    font-family: 'Inter', sans-serif;
}

.page__container {

    max-width: 1400px;
    margin: 0 auto;
    border-radius: 10px;
}

.header {

    &__block {

        display: flex;
        justify-content: space-between;
        padding: 17px 20px 25px 20px;
        align-items: center;
        flex-wrap: wrap;
        background-color: #FFFFFF;
    }

    &__mainlogo {

        margin-right: 24px;

        &--block {

            display: flex;
            align-items: center;
            flex-wrap: nowrap;

        }

    }

    &__logo {

        display: block;
        width: 50px;
        height: 50px;
        margin-right: 13px;
    }

    &__name {

        min-width: 125px;

        &--main {
            font-weight: bold;
            font-size: 24px;
            line-height: 29px;
            color: #000000;
            margin-bottom: 5px;
        }

        &--second {

            &--block {
                display: flex;
                align-items: center;
                justify-content: space-between;
                margin-top: -6px;
                flex-wrap: nowrap;
            }

            &--text {
                display: block;
                font-weight: 500;
                font-size: 14px;
                color: #191B20;
                margin: 0 0 2px 0;
            }

            &--logo {
                display: block;
                margin-left: 5px;
                color: #80DA60;
            }

        }
    }

    &__search {

        width: 100%;
        display: flex;
        align-items: center;

        &--block {

            max-width: 434px;
            min-width: 300px;
            margin-right: 24px;
            flex-grow: 1;

        }

        &--field {

            width: 100%;
            height: 42px;
            background: #FFFFFF;
            border: 1px solid #EBEBEB;
            box-sizing: border-box;
            border-radius: 21px;
            padding-left: 20px;

            &::placeholder {
                font-weight: 500;
                font-size: 16px;
                line-height: 19px;
                color: #8E9093;
            }

        }


        &--button {

            display: block;
            margin-left: -30px;
            color: #8E9093;
            font-size: 16px;

        }

    }

    &__nav {
        display: flex;
        justify-content: space-between;

        &--text {
            display: block;
            margin: 0;
            padding: 0;
            text-align: center;
        }
    }

    &__gifts {

        display: flex;
        align-items: center;
        margin-right: 32px;

        &--logo {
            display: block;
            margin-right: 10px;
            color: #FFCD1D;
            font-size: 20px;
        }

    }

    &__buy {

        display: flex;
        align-items: center;
        margin-right: 32px;

    }

    &__support {

        display: flex;
        align-items: center;
        margin-right: 28px;

        &--logo {
            display: block;
            margin-right: 10px;
            color: #80DA60;
            font-size: 20px;
        }

    }

    &__purchases {

        display: flex;
        align-items: center;
        padding: 15px;


        &--logo {

            display: block;
            margin-right: 10px;
            filter: none;
            color: #9B51E0;
            font-size: 20px;

        }

        &--wrapper {

            background:rgba(128,96,218,0.1);
            border-radius: 22px;

        }

        &--text {

            margin: 0;
            font-size: 16px;
            line-height: 19px;
            color: #9B51E0;

        }

    }

    &__burger {

        display: none;

        &--logo {
            width: 15px;
            height: 15px;
        }

    }

}

.banner {

    &__block {

        background-color: #FFFFFF;
        margin-bottom: 20px;
        padding: 0 20px 20px 20px;
    }

    &__first {

        &--block {

            position: relative;

        }

        &--image {

        height: 250px;
        background: url("./img/banner_first.png");
        background-size: cover;
        border-radius: 10px;
        position: relative;

        }

        &--toplayer {

            position: absolute;
            width: 100%;
            top: 0;
            left: 0;
            height: 250px;
            border-radius: 10px;
            background-color: rgba(0, 0, 0, 0.2);
            display: flex;
            justify-content: center;

            &--content {

                width: 66%;
                display: flex;
                justify-content: space-between;
                align-items: center;
                flex-wrap: wrap;

            }

            &--text {
                display: block;
                font-weight: bold;
                font-size: 53px;
                line-height: 52px;
                /* Встроить шрифт робото */
                color: #FFFFFF;
            }


            &--timer {

                &--back {

                    width: 281px;
